Lösning: Vi tar en heuristisk lösning. Antag att rektangeln är en kvadrat. Då är $O$ medelpunkten av $ABCD$ och $AB=AD$. Om vi tar en linje som går genom $O$ och är vinkelrät med $AB$, så är det en linje som delar rektangeln i två enkta kvadrater. Om vi tar en punkt i en av de två kvadraterna, så är den närmare till $O$ än till en av de fyra hörnen. Då är sannolikheten $\frac{1}{2}$.

